import React from 'react';
import logo from './logo.svg';
import './App.css';
import ReactNode from './ReactNode';
import Provider from 'react-dims';


function App() {
  // var data = [
  // [{row:"32", column:"A", value:0},{row:"32", column:"B", value:1},{row:"32", column:"D", value:2}],
  // [{row:"34", column:"A", value:3},{row:"34", column:"B", value:4},{row:"34", column:"D", value:5}],
  // [{row:"36", column:"A", value:6},{row:"36", column:"B", value:7},{row:"36", column:"D", value:8}],
  // ]
  let data = [1,2,4,5,6,3,7,8,4,3];

  return (
    <div className="App">
      <div className="matrix">
        <Provider>
         <ReactNode data={data} id ="matrix"/>
        </Provider>
      </div>
    </div>
  );
}

export default App;
